import "./style.min.css";

const PrivateRoute = ({ content, title }) => {
  const [auth, setAuth] = useState(true);

  const { user } = useSelector((state) => state.auth);

  useEffect(() => {}, []);

  return (
    <Fade>
      <div className="route">
